const api_base_url = "http://localhost:5000"

export const predict = async (text) => {
  const rawResponse = await fetch(`${api_base_url}/mann-eller-kvinne`, {
    method: 'GET',
    headers: {
      'Content-Type': 'application/json',
    }
  });
  const data = await rawResponse.json();
  return "yeet";
}
